import React from "react";
import Nav from "react-bootstrap/Nav";

let json = [
  {
    main_info: {
      name: "Лена Новикова",
      id: "2",
      phone: "89764554323",
      gender: "Мужской",
      birthday: "09.12.1986",
      subway: "Василеостровская",
      address: "Наставников 15 к2 кв33",
    },
    bank_info: {
      bank: "ВТБ",
      card: "3333 4445 4532 3353",
    },
    documents: {
      nationality: "РФ",
      passport: "4565 567887",
      issued_by: "ТП 44 по СПб и Лен обл",
      passport_validity: "12.09.2024",
      birthplace: "Узбекистан",
      residence: "Наставников 15 к2 кв33",
      patent: "",
      residence_validity: "patent",
      snils: "",
      identification_code: "354790582525",
      medical_book: "",
    },
    about_info: {

    },
    role: "Бригадир",
    division: "В2В",
  },
];

const NavBar = () => {
  return (
    <Nav justify variant="tabs" defaultActiveKey="/home">
      <Nav.Item>
        <Nav.Link href="/home">Active</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="link-1">Loooonger NavLink</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="link-2">Link</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="disabled" disabled>
          Disabled
        </Nav.Link>
      </Nav.Item>
    </Nav>
  );
};

export default NavBar;
